// Before:
hello = function() {
    return "Hello World";
}

// Arrow functions
hello2 = () => {
    return "HelloWorld";
}

// with Arrow functions return value by default 
hello3 = () => "Hello World";

//Arrow functions with parameters
hello4 = (val) => "Hello" + val;

//Arrow functions with out paranthesis
hello5 = val => "Hello "+ val;

